import React from 'react';
import Sidebar from '../components/Sidebar';
import { Routes, Route, Navigate } from 'react-router-dom';
import MaintenanceRequests from './maintenance/MaintenanceRequests';

export default function MaintenanceDashboard() {
  const links = [
    { to: '/maintenance/requests', name: 'Maintenance Requests' },
  ];

  return (
    <div className="app-layout">
      <Sidebar links={links} />
      <div className="content">
        <Routes>
          <Route path="/" element={<h2>Welcome Maintenance Staff</h2>} />
          <Route path="requests" element={<MaintenanceRequests />} />
          <Route path="*" element={<Navigate to="/maintenance" replace />} />
        </Routes>
      </div>
    </div>
  );
}
